// screens/StaffListScreen.js
import React from 'react';
import { View, Text, FlatList, StyleSheet,Image } from 'react-native';
import { List } from 'react-native-paper';
 
 

const StaffListScreen = ({ navigation }) => {
  // Dummy data for demonstration purposes
  // const staffData = [
  //   { id: 1, name: 'John Doe' },
  //   { id: 2, name: 'Jane Smith' },
  //   { id: 3, name: 'Bob Johnson' },

  //   // Add more staff profiles as needed
  // ];
  const staffData = [
    {
      id: 1,
      name: 'John Smith',
      phoneNumber: '02 9988 2211',
      address: {
        street: '1 Code Lane',
        city: 'Javaville',
        state: 'NSW',
        postalCode: '0100',
        country: 'Australia',
      },
    },
    {
      id: 2,
      name: 'Sue White',
      phoneNumber: '03 8899 2255',
      address: {
        street: '16 Bit Way',
        city: 'Byte Cove',
        state: 'QLD',
        postalCode: '1101',
        country: 'Australia',
      },
    },
    {
      id: 3,
      name: 'Bob O’Bits',
      phoneNumber: '05 7788 2255',
      address: {
        street: '8 Silicon Road',
        city: 'Cloud Hills',
        state: 'VIC',
        postalCode: '1001',
        country: 'Australia',
      },
    },
    {
      id: 4,
      name: 'Mary Blue',
      phoneNumber: '06 4455 9988',
      address: {
        street: '4 Processor Boulevard',
        city: 'Appletson',
        state: 'NT',
        postalCode: '1010',
        country: 'Australia',
      },
    },
    {
      id: 5,
      name: 'Mick Green',
      phoneNumber: '02 9988 1122',
      address: {
        street: '700 Bandwidth Street',
        city: 'Bufferland',
        state: 'NSW',
        postalCode: '0110',
        country: 'Australia',
      },
    },
    // Add more staff profiles as needed
  ];
  
  

   

  return (
    <View style={styles.container}>
         <Image
        source={require('./assets/favicon.png')}
       
        
      />
      <Text style={styles.title}>ROI Staff Profiles</Text>
      <FlatList
        data={staffData}
        keyExtractor={(item) => item.id.toString()}
        renderItem={({ item }) => (
          <List.Item
            title={item.name}
            onPress={() => navigation.navigate('StaffDetails', { staff: item })}
          />
        )}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 16,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 16,
  }, logo: {
    width: 200,
    height: 100,
  },
});

export default StaffListScreen;
